import React from 'react';
import Modals from './Modals';
// import SVGDiagram from './SVGDiagram';
import SVGDiagramV2 from './SVGDiagramV2';
import Key from '../Diagram/Key';
import '../../Styles/App.css';

export const Diagram = ({
    anchorCharts,
    setAnchorCharts,
    multiGlossaries,
    setMultiGlossaries,
    notice,
    setNotice,
    multiParent,
    setMultiParent,
    multiSummaries,
    setMultiSummaries,
    authentic,
    setAuthentic,
    summaries,
    setSummaries,
    textSketch,
    setTextSketch,
    setFreshLit,
    freshLit,
    opener,
    setOpener,
}) => {
    return (
        <div className='main-diagram'>
            <div className='diagram-container'>
                <SVGDiagram2
                    className='diagram-svg'
                    anchorCharts={anchorCharts}
                    setAnchorCharts={setAnchorCharts}
                    multiGlossaries={multiGlossaries}
                    setMultiGlossaries={setMultiGlossaries}
                    notice={notice}
                    setNotice={setNotice}
                    multiParent={multiParent}
                    setMultiParent={setMultiParent}
                    multiSummaries={multiSummaries}
                    setMultiSummaries={setMultiSummaries}
                    authentic={authentic}
                    setAuthentic={setAuthentic}
                    summaries={summaries}
                    setSummaries={setSummaries}
                    textSketch={textSketch}
                    setTextSketch={setTextSketch}
                    setFreshLit={setFreshLit}
                    freshLit={freshLit}
                    opener={opener}
                    setOpener={setOpener}
                />
                <Key className='key' />
            </div>

            <div className='modals-container'>
                <Modals
                    anchorCharts={anchorCharts}
                    setAnchorCharts={setAnchorCharts}
                    multiGlossaries={multiGlossaries}
                    setMultiGlossaries={setMultiGlossaries}
                    notice={notice}
                    setNotice={setNotice}
                    multiParent={multiParent}
                    setMultiParent={setMultiParent}
                    multiSummaries={multiSummaries}
                    setMultiSummaries={setMultiSummaries}
                    authentic={authentic}
                    setAuthentic={setAuthentic}
                    summaries={summaries}
                    setSummaries={setSummaries}
                    textSketch={textSketch}
                    setTextSketch={setTextSketch}
                    setFreshLit={setFreshLit}
                    freshLit={freshLit}
                    opener={opener}
                    setOpener={setOpener}
                    className='modals'
                />
            </div>
        </div>
    );
};

export default Diagram;
